import ProfilemodalRow from "./ProfilemodalRow.jsx"
import {
    AdjustmentsIcon,
    CreditCardIcon,
    LogoutIcon,
    QuestionMarkCircleIcon,

    } from '@heroicons/react/outline'



function ProfileModal({setshowProfile}) {
    return (
        <div className="fixed p-4 sm:w-1/6 w-1/2 right-30 top-20 sm:top-20 rounded-xl h-full z-0 flex justify-center bg-white">

            <div className="overflow-scroll">

                    <div className="p-1 flex justify-center items-center rounded-full mx-4 mt-2 cursor-pointer hover:bg-gray-500 hover:text-white font-light text-gray-400 bg-gray-100"
                     onClick={ () => 
                        { setshowProfile(false);}
                        }>
                        hide
                    </div>

            {/* Heading */}

                <div className= "cursor-pointer mx-3 p-3 space-y-2 rounded-xl hover:bg-gray-100 items-center mt-4 mb-3">
                <img src="./assets/images/milome.jpeg" alt="DP" className="mx-auto rounded-full h-8 w-8"/>
                    <p className= "text-gray-500 text-center text-sm font-semibold">Visit Portfolio</p> 
                </div>  

                <div className= "border-gray-200 border-t">
                <ProfilemodalRow Icon = {CreditCardIcon} title ="Wallet"/>
                <ProfilemodalRow Icon = {AdjustmentsIcon} title ="Settings"/>
                <ProfilemodalRow Icon = {QuestionMarkCircleIcon} title ="Help"/>
                <ProfilemodalRow Icon = {LogoutIcon} title ="Logout"/>

            </div>
            </div>

        </div>
    )
}

export default ProfileModal;
